ale_range = function (range, min, max, pad) {\n        \"use strict\";\n        if (min !== Infinity &amp;&amp; max !== -Infinity) {\n            pad = pad ? (max - min) * .03 : 0;\n            range.start = min - pad;\n            range.end = max + pad;\n        } else console.error('backtesting: scale range error:', min, max, range);\n    };\n}\n\nclearTimeout(window._bt_autoscale_timeout);\n\nwindow._bt_autoscale_timeout = setTimeout(function () {\n    /**\n     * @variable cb_obj `fig_ohlc.x_range`.\n     * @variable source `ColumnDataSource`\n     * @variable ohlc_range `fig_ohlc.y_range`.\n     * @variable volume_range `fig_volume.y_range`.\n     */\n    \"use strict\";\n\n    let i = Math.max(Math.floor(cb_obj.start), 0),\n        j = Math.min(Math.ceil(cb_obj.end), source.data['ohlc_high'].length);\n\n    let max = Math.max.apply(null, source.data['ohlc_high'].slice(i, j)),\n        min = Math.min.apply(null, source.data['ohlc_low'].slice(i, j));\n    _bt_scale_range(ohlc_range, min, max, true);\n\n    if (volume_range) {\n        max = Math.max.apply(null, source.data['Volume'].slice(i, j));\n        _bt_scale_range(volume_range, 0, max * 1.03, false);\n    }\n\n}, 50);\n"},"id":"1447716","type":"CustomJS"},{"attributes":{"coordinates":null,"formatter":{"id":"1447701"},"group":null,"major_label_policy":{"id":"1447702"},"minor_tick_line_color":null,"ticker":{"id":"1447673"}},"id":"1447672","type":"LinearAxis"},{"attributes":{"axis":{"id":"1447581"},"coordinates":null,"dimension":1,"group":null,"ticker":null},"id":"1447584","type":"Grid"},{"attributes":{},"id":"1447653","type":"UnionRenderers"},{"attributes":{"source":{"id":"1447561"}},"id":"1447607","type":"CDSView"},{"attributes":{},"id":"1447652","type":"Selection"},{"attributes":{"below":[{"id":"1447577"}],"center":[{"id":"1447580"},{"id":"1447584"}],"height":90,"left":[{"id":"1447581"}],"min_border_bottom":6,"min_border_left":0,"min_border_right":10,"min_border_top":3,"outline_line_color":"#666666","rend
